import {StyleSheet} from 'aphrodite';
const styles = StyleSheet.create({
    wrap:{
        width: "100%",
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center'
    },
    twrap:{
        width: '630px',
        marginTop: '250px',
        fontFamily: "SFUIDisplay-Light",
        lineHeight: "28px",
        fontWeight: 300,
        fontSize: '18px'
    },
    twrap2:{
        marginTop: "40px",
        marginBottom: "100px",
        width: "630px"
    },
    h:{
        fontFamily: "SFUIDisplay-Bold",
        fontSize: "20px",
        fontWeight: 700,
        marginBottom: '30px'
    },
    t:{
        color: "#acacac",
        lineHeight: '33px',
        fontSize: "18px",
        fontWeight: 300,
        fontFamily: "SFUIDisplay-Light"
    }
});
export default styles;
